import { multiLenguageConstants, userConstants } from '../constants'

const initialState = {
    data: {
        lenguage: 'es'
    }
}

export default function (state= initialState, action) {
    switch(action.type) {
        case multiLenguageConstants.GET_SELECTED_SUCCESS:
            return {
                ...state,
                data: action.data
            }
        default:
            return state
    }
}
